import './List.css'
import Checkbox from '../Checkbox/Checkbox';

function List(props){

    const background = {
        backgroundColor: "#" + props.hexCode,
    }

    return(
    <div style={{background}}>
        <Checkbox></Checkbox>
        <div>{props.rarity}</div>
        <div hidden='true'>{props.hexCode}</div>
    </div>);
}

export default List;
